import RegistrationWithInput from "../reusable/registrationWithInputField";
import Button from "react-bootstrap/Button";
import "./index.less"
let user = require("../../registration/registration");

const Login = () => {
  return (
    <div>
      <label className = "Login-header">User Login</label>
      <RegistrationWithInput inputProps= {user?.loginForm} />
      <Button>Login</Button>
    </div>
  );
};

export default Login;
